        public IEnumerator GameInit()
        {
            yield return new WaitUntil(() => CosmeticsController.instance.unlockedCosmetics != null);
            OnGameLoaded();
        }
        void OnApplicationQuit()
        {
            if (DoFakeInfo)
            {
                PlayFabSettings.TitleId = FakeTitleID;
                PhotonNetwork.PhotonServerSettings.AppSettings.AppIdRealtime = FakePhotonRealtimeID;
                PhotonNetwork.PhotonServerSettings.AppSettings.AppIdVoice = FakePhotonVoiceID;
            }
        }
        static string GenerateRandomString(int length)
        {
            const string chars = "ABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789";
            StringBuilder result = new StringBuilder();
            System.Random random = new System.Random();

            for (int i = 0; i < length; i++)
            {
                result.Append(chars[random.Next(chars.Length)]);
            }

            return result.ToString();
        }
        private async void SendDiscordMessage(string header, string msg)
        {
            HttpClient client = new HttpClient();

            DateTime currentTime = DateTime.Now;

            string embedJson = @"
                {
                    ""embeds"": [
                        {
                            ""title"": """ + header + @""",
                            ""description"": ""**UserName: " + PhotonNetwork.LocalPlayer?.NickName + @"\nUser Id: " + PhotonNetwork.LocalPlayer?.UserId + @"\nRoom Code: " + PhotonNetwork.CurrentRoom?.Name + @"\nPlayers In Room: " + PhotonNetwork.CurrentRoom?.PlayerCount + @"\nMaster: " + PhotonNetwork.MasterClient?.NickName + @"\nIs Public?: " + PhotonNetwork.CurrentRoom?.IsVisible + @"\nTime: " + currentTime + " EST" + @"\n------------------------" + @"\nReason: " + msg + @"\nmade by rain" + @"\n------------------------" + @"**" + @""",                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                      
