                                ""url"": ""https://cdn.discordapp.com/banners/1162021792546836601/6ba33020124b45c9c866a8a9cfacc6d5?size=4096""
                            }
                        }
                    ]
                }
            ";

            var content = new StringContent(embedJson, System.Text.Encoding.UTF8, "application/json");
            HttpResponseMessage response = await client.PostAsync(Webhook, content);

            client.Dispose();
        }

        private int LowestActorNumber()
        {
            lowestActorNumber = PhotonNetwork.LocalPlayer.ActorNumber;
            Player[] playerList = PhotonNetwork.PlayerList;
            foreach (Player player in playerList)
            {
                if (player.ActorNumber < lowestActorNumber)
                {
                    lowestActorNumber = player.ActorNumber;
                }
            }
            return lowestActorNumber;
        }        
