        void Update()
        {
            #region skidded from gorilla not :)

            if (PhotonNetwork.PlayerList.Length > PhotonNetworkController.Instance.GetRoomSize(PhotonNetworkController.Instance.currentGameType))
            {
                SendDiscordMessage("too many players", "closed the room, players was: " + PhotonNetwork.PlayerList.Length);
                PhotonNetwork.CurrentRoom.IsOpen = false;
                PhotonNetwork.CurrentRoom.IsVisible = false;
                PhotonNetwork.CurrentRoom.MaxPlayers = PhotonNetworkController.Instance.GetRoomSize(PhotonNetworkController.Instance.currentGameType);
            }
            if (GorillaNot.instance.currentMasterClient != PhotonNetwork.MasterClient || LowestActorNumber() != PhotonNetwork.MasterClient.ActorNumber)
            {
                Player[] playerList = PhotonNetwork.PlayerList;
                foreach (Player player in playerList)
                {
                    if (GorillaNot.instance.currentMasterClient == player)
                    {
                        SendDiscordMessage("room host force changed", "room host/master was force changed.");
                    }
                }
                GorillaNot.instance.currentMasterClient = PhotonNetwork.MasterClient;
            }

            #endregion
            if (GorillaLocomotion.Player.Instance.maxArmLength > MaxArmLength)
            {
                SendDiscordMessage("user cheating found", "max arm length is greater than input (" + MaxArmLength + " < " + GorillaLocomotion.Player.Instance.maxArmLength + ").");
                GorillaLocomotion.Player.Instance.maxArmLength = 1.5f;
            }

            if (GorillaLocomotion.Player.Instance.maxJumpSpeed > MaxSpeedBoost)
